import React from 'react';

class Video extends React.Component {
  state = {
    que: undefined
  }
  render () {
    return (
      <form onSubmit={this.props.userMethod} className="searcLineLayout">
        <input type="text" name="searchQuery" autoComplete="off" className="string"/>
        <button className="button">Найти</button>
      </form>
    )
  }
}

export default Video;
